import React, { useState } from 'react';
import PaymentForm from './PaymentForm';
import './PlanSelection.css';

function PlanSelection() {
const [selectedPlan, setSelectedPlan] = useState('Básico con Anuncios');
const [showPaymentForm, setShowPaymentForm] = useState(false);
const [step, setStep] = useState(1);

const handlePlanSelection = (plan) => {
    setSelectedPlan(plan);
    setStep(1);
};

const handleNextStep = () => {
    setStep(2);
};

const handlePaymentFormSubmit = () => {
    // Add validation and error handling here
    console.log('Payment form submitted');
};

return (
    <div>
        <h2>Selecciona el plan ideal para ti</h2>
        {step === 1 && (
            <div>
                <ul>
                    <li>Ve todo lo que quieras</li>
                    <li>Recomendaciones exclusivas para ti</li>
                    <li>Cambia de plan o cancélalo cuando quieras</li>
                </ul>
                <table>
                    <thead>
                        <tr>
                            <th>Nombre</th>
                            <th>Precio del mes</th>
                            <th>Calidad de video</th>
                            <th>Resolución</th>
                            <th>Multidispositivo</th>
                            <th>Descargas</th>
                        </tr>
                    </thead>
                    <tbody>
                        <tr>
                            <td
                                className={`${selectedPlan === 'Básico con Anuncios' ? 'selected' : ''}`}
                                onClick={() => handlePlanSelection('Básico con Anuncios')}
                            >
                                Básico con Anuncios
                            </td>
                            <td>5,49€</td>
                            <td>Buena</td>
                            <td>720p</td>
                            <td>-</td>
                            <td>-</td>
                        </tr>
                        <tr>
                            <td
                                className={`${selectedPlan === 'Estándar' ? 'selected' : ''}`}
                                onClick={() => handlePlanSelection('Estándar')}
                            >
                                Estándar
                            </td>
                            <td>12,99€</td>
                            <td>Muy buena</td>
                            <td>1080p</td>
                            <td>-</td>
                            <td>Descarga en 1 dispositivo</td>
                        </tr>
                        <tr>
                            <td
                                className={`${selectedPlan === 'Premium' ? 'selected' : ''}`}
                                onClick={() => handlePlanSelection('Premium')}
                            >
                                Premium
                            </td>
                            <td>17,99€</td>
                            <td>Excelente</td>
                            <td>4K + HDR</td>
                            <td>4 dispositivos

Ultra HD</td>
<td>Descarga en 4 dispositivos</td>
</tr>
</tbody>
</table>
<button onClick={handleNextStep}>Continuar</button>
</div>
)}
{step === 2 && (
<div>
<h3>Confirmar plan: {selectedPlan}</h3>
<button onClick={() => setShowPaymentForm(true)}>Seleccionar método de pago</button>
</div>
)}
{showPaymentForm && (
<div>
<h3>Selecciona tu método de pago</h3>
<PaymentForm onSubmit={handlePaymentFormSubmit} />
</div>
)}
  </div>
);
}
